import App, { Container } from "next/app";
import Page from "../components/Page";
import "./style.css";
export default class MyApp extends App {
  state = {
    test: "hello world"
  };
  render() {
    const { Component, pageProps } = this.props;
    return (
      <Page state={this.state}>
        <Component {...pageProps} />
      </Page>
    );
  }
}
